import axios from "axios";

const ListPage = () => {

    const getPosts = () => {
        axios.get('http://localhost:3001/posts').then((res)=>{
            console.log(res);
        })
    }

    getPosts();

    return (
        <div>ListPage</div>
    );
};

export default ListPage;
